import NavBottom from "@/components/Main/NavBottom.vue";
import { apiGetMatchs, apiGetMyMatchList, apiGetRankMatchList } from "../api/match.js";
export default {
  created: function created() {
    // this.showmatchlist2();
    this.lang = JSON.parse(localStorage.getItem("lang")).tag;
    this.getrankmatch();
    this.getMyrank();
  },
  data: function data() {
    return {
      ShowExplain: false,
      test11: true,
      test22: false,
      bgc1: false,
      matchId: {
        matchTypeId: "2",
        index: 1
      },
      matchlist: [],
      testlist: [1],
      myranklist: [],
      lang: ""
    };
  },
  components: {
    NavBottom: NavBottom
  },
  methods: {
    //跳转排位赛事
    getrankmatch: function getrankmatch() {
      var _this = this;

      var data = {
        index: 1,
        count: 100,
        isAll: true
      };
      apiGetRankMatchList(data, true).then(function (res) {
        _this.matchlist = res.Data;
      });
    },
    gorankmatch: function gorankmatch(id, name) {
      this.$refs.son.show = false;
      this.$store.commit("upMatchid", {
        MatchId: id,
        MatchName: name
      });
      this.$router.push("/rankmatch");
    },
    //排位赛选择
    goChoose: function goChoose() {
      this.$router.push("/rankchoose");
    },
    //获得个人排位赛信息
    getUserRankInfo: function getUserRankInfo() {
      this.$refs.son.show = false;
      this.$store.dispatch("asyncGetUserRankInfo");
    },
    showmatchlist2: function showmatchlist2() {
      var data = {
        matchTypeId: "2",
        index: 1,
        count: 100
      };
      this.$store.dispatch("asyncgetMatchList", data);
    },
    //我的排位
    getMyrank: function getMyrank() {
      var _this2 = this;

      var data = {
        index: 1,
        count: 100
      };
      apiGetMyMatchList(data, true).then(function (res) {
        _this2.myranklist = res.Data;
      });
    },
    //跳转
    goJump: function goJump(id, name) {
      this.$store.commit("upMatchid", {
        MatchId: id,
        MatchName: name
      });
      this.$router.push("/ranklistdetails");
    },
    //列表
    getmatchlist: function getmatchlist() {
      this.$refs.son.show = false;
      this.$store.dispatch("asyncGetHistoryMatchList");
    },
    //  tab栏
    //左
    test1: function test1() {
      this.$refs.son.show = false;
      this.test11 = true;
      this.test22 = false;
      this.bgc1 = false;
      var data = {
        test11: true,
        test22: false,
        bgc1: false
      };
      this.$store.commit("upBoolen", data); // alert(1);
    },
    // tab栏
    test2: function test2() {
      this.$refs.son.show = false;
      this.test11 = false;
      this.test22 = true;
      this.bgc1 = true;
      var data = {
        test11: false,
        test22: true,
        bgc1: true
      };
      this.$store.commit("upBoolen", data); // alert(2);
    },
    showPopup: function showPopup() {
      this.$refs.son.show = false;
      this.ShowExplain = true;
    },
    hideExplain: function hideExplain() {
      this.$refs.son.show = false;
      this.ShowExplain = false;
    }
  }
};
